                <div className="product-details">
                    <div className="product-field">
                        <label>Code:</label>
                        <span>{props.product.code}</span>
                    </div>
                    <div className="product-field">
                        <label>Value:</label>
                        <span>{props.product.value}</span>
                    </div>
                </div>
            </div>
    );
};

export default ProductItem;
